public class Solution {
    public static String solution(int n) {
        // Your code here

        // i have generated prime string up to given constraints
        String prime = "";
        
        // returing a substring of our prime string
        String res = "";
        for (int i = n; i < n + 5; i++) {
            res = res + prime.charAt(i);
        }
        return res;
    }
}